import { Card, CardMedia, Grid, Paper, Typography } from '@mui/material';
import { Box, Container, Stack } from '@mui/system';
import React from 'react'
import { useSelector } from "react-redux";
import { styled } from '@mui/material/styles';
import MaleIcon from '@mui/icons-material/Male';
import FemaleIcon from '@mui/icons-material/Male';

const SingularPet = () => {
    const infoView = useSelector((state)=>state.id);
    console.log(infoView)

    const Item = styled(Paper)(({ theme }) => ({
        backgroundColor: theme.palette.mode === 'dark' ? '#1A2027' : '#fff',
        ...theme.typography.body2,
        padding: theme.spacing(1),
        textAlign: 'center',
        color: theme.palette.text.secondary,
    }));

    return (
    <>
        <Container>
                <CardMedia sx={{padding:0, borderRadius:10}}>
                    <img
                    src={infoView.photos}
                    width='100%'
                    id='petPhoto'
                    />
                </CardMedia>
                <br/>
                <Card sx={{borderRadius:5}}>
                    <Stack padding={2} >
                        <Box sx={{display:'flex', flexDirection:'row'}} fullWidth>
                            <Typography variant='h4' width={'20%'}>{infoView.name}</Typography>
                            <Typography variant='h4' id='genero'>{infoView.gender != 'macho'?<MaleIcon/>:<FemaleIcon/>}</Typography>
                        </Box>
                    </Stack>
                </Card>
        </Container>
    </>
    )
}

export default SingularPet
